import styled from 'styled-components';
import {
    YoutubeFilled,
    TwitterSquareFilled,
    RedditCircleFilled,
    AmazonSquareFilled
} from '@ant-design/icons'

export const YoutubeIconStyled = styled(YoutubeFilled)`
    font-size: 2.5em;
`;

export const TwitterIconStyled = styled(TwitterSquareFilled)`
    font-size: 2.5em;
`;

export const RedditIconStyled = styled(RedditCircleFilled)`
    font-size: 2.5em;
`;

export const AmazonIconStyled = styled(AmazonSquareFilled)`
    font-size: 2.5em;
`;
